import { loremIpsum } from 'lorem-ipsum';

const Page = ({number}) => {

    const lorem = new LoremIpsum({
        sentencesPerParagraph: {
            max: 8,
            min: 4
        },
        wordsPerSentence: {
            max: 16,
            min: 4
        }
    });
    return(
        <>
            <h2>Page {number}</h2>
            <section>
                <h4>Page content:</h4>
                <article>
                    {lorem}
                </article>
            </section>
        </>
    );
};

export const PageOne = () => Page(1);
export const PageTwo = () => Page(2);
export const PageThree = () => Page(3);
export const PageFour = () => Page(4);
